  `status_desc` varchar(1000) DEFAULT NULL,
  `is_certificate_issued` enum('Yes','No') NOT NULL DEFAULT 'No',
  `certificate_issue_date` date DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `updated_by` int(11) NOT NULL COMMENT 'record updated user id'
