(1, 'Registration', 'Registration', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>__SITE_LOGO__</strong></p>\n<p>\n	&nbsp;</p>\n<h2>\n	<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Welcome to __SITE_TITLE__ </strong></h2>\n<p>\n	&nbsp;</p>\n<p>\n	Dear <strong>__USER__NAME__</strong>,&nbsp;</p>\n<p>\n	You have successfully Registered in&nbsp;<strong>__SITE_TITLE__</strong></p>\n<p>\n	<strong>Your credentials</strong></p>\n<p>\n	Email<strong>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;__EMAIL__</strong></p>\n<p>\n	Password<strong>&nbsp; __PASSWORD__</strong></p>\n<p>\n	We are really excited that you decide to try our services,welcome and thank you for the trust!!</p>\n<p>\n	Please click this link for <strong>__ACCOUNT_ACTIVATOIN_LINK__</strong></p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp; &nbsp; &nbsp; &nbsp;<strong>__ANDROID__</strong>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>__IOS__</strong>&nbsp; &nbsp; &nbsp; &nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Regards,</strong>&nbsp;<br />\n	<br />\n	<strong>__SITE_TITLE__</strong> | Tutor System</p>\n<p>\n	&nbsp;</p>\n', '2018-12-21 11:02:55', NULL, 'Active', '__SITETITLE__\n\n__FIRST_NAME__\n\n__LAST_NAME__\n\n__LOGO__\n\n__CONTACTUS__\n\n__ACTIVATELINK__\n\n__URL__\n\n__COPYRIGHTS__\n\n__EMAIL__\n\n__PASSWORD__', NULL, 'Tutors'),
(3, 'Forgot Password', 'Forgot Password', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>__SITE_LOGO__</strong></p>\n<p>\n	&nbsp;</p>\n<h2>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>Welcome to __SITE_TITLE__</strong></h2>\n<p>\n	A new password was requested for the user <strong>__EMAIL__</strong>,&nbsp;</p>\n<p>\n	Please click on the link to set your&nbsp;password&nbsp;___RESET_YOUR_PASSWORD___</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Regards,</strong>&nbsp;<br />\n	<br />\n	<strong>__SITE_TITLE__</strong> | Tutors System</p>\n', '2018-12-21 11:06:18', NULL, 'Active', '<p>\r\n	__SITE_TITLE__</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	__FIRST_NAME__</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	__LAST_NAME__</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	__LINK__</p>', NULL, 'Tutors'),
(4, 'App Subscribe Link', 'Your App Links', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>__SITE_LOGO__</strong></p>\n<p>\n	&nbsp;</p>\n<h2>\n	<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Welcome to __SITE_TITLE__</strong></h2>\n<p>\n	&nbsp;</p>\n<p>\n	We are really excited that you decide to try our services,welcome and thank you for the trust!!</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp; &nbsp; &nbsp; &nbsp;<strong>__ANDROID_LINK__</strong>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>__IOS_LINK__</strong>&nbsp; &nbsp; &nbsp; &nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Regards,</strong>&nbsp;<br />\n	<br />\n	<strong>__SITE_TITLE__</strong> | Tutor System</p>\n<p>\n	&nbsp;</p>\n', '2018-12-21 11:08:09', NULL, 'Active', '<p>\n	__ANDROID_LINK__</p>\n<p>\n	&nbsp;</p>\n<p>\n	__IOS_LINK__</p>\n', NULL, 'Tutors'),
(5, 'Tutor Booking Success Email', 'Booking Request From Student', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>__SITE_LOGO__</strong></p>\n<p>\n	&nbsp;</p>\n<h2>\n	<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Welcome to __SITE_TITLE__ </strong></h2>\n<p>\n	&nbsp;</p>\n<p>\n	Hello&nbsp;<strong>__TUTOR_NAME__</strong>,&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	Student&nbsp;<strong>__STUDENT_NAME__</strong> booked you for the course&nbsp;<strong>__COURSE_NAME__</strong> ,</p>\n<p>\n	for the time-slot&nbsp;<strong>__DATE_TIME__</strong> and&nbsp;<strong>__LOCATION__</strong> as preferred location for sessions.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Please&nbsp;<strong>__LOGIN_LINK__</strong> to view the booking details.</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Regards,</strong>&nbsp;<br />\n	<br />\n	<strong>__SITE_TITLE__</strong> | Tutor System</p>\n<p>\n	&nbsp;</p>\n', '2018-12-21 11:12:10', NULL, 'Active', '__TUTOR_NAME__\n\n__STUDENT_NAME__\n\n__COURSE_NAME__\n\n__DATE_TIME__\n\n__LOCATION__\n\n__LOGIN_HERE__', NULL, 'Tutors'),
(6, 'Send Student\'s Address Email', 'Student\'s Address For Tutoring', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>__SITE_LOGO__</strong></p>\n<p>\n	&nbsp;</p>\n<h2>\n	<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Welcome to __SITE_TITLE__ </strong></h2>\n<p>\n	&nbsp;</p>\n<p>\n	Hello&nbsp;<strong>__TUTOR__NAME__</strong>,&nbsp;</p>\n<p>\n	You approved student&nbsp;<strong>__STUDENT_NAME__</strong> booking for the course&nbsp;<strong>__COURSE_NAME__</strong> ,</p>\n<p>\n	for the time-slot&nbsp;<strong>__DATE_TIME__</strong> and&nbsp;<strong>__LOCATION__</strong> as preferred location for sessions.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Below is the address of the Student</p>\n<p>\n	<strong>__STUDENT_ADDRESS__</strong></p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Regards,</strong>&nbsp;<br />\n	<br />\n	<strong>__SITE_TITLE__</strong> | Tutor System</p>\n<p>\n	&nbsp;</p>\n', '2018-12-21 11:16:31', NULL, 'Active', '__TUTOR_NAME__\n\n__STUDENT_NAME__\n\n__COURSE_NAME__\n\n__DATE_TIME__\n\n__LOCATION__\n\n__STUDENT_ADDRESS__\n\n__LOGIN_HERE__', NULL, NULL),
(7, 'Send Student\'s Skype Id', 'Send Student\'s Skype Id', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>__SITE_LOGO__</strong></p>\n<p>\n	&nbsp;</p>\n<h2>\n	<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Welcome to __SITE_TITLE__ </strong></h2>\n<p>\n	&nbsp;</p>\n<p>\n	Hello&nbsp;<strong>__TUTOR__NAME__</strong>,&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	Student&nbsp;<strong>__STUDENT_NAME__</strong> started the course&nbsp;<strong>__COURSE_NAME__</strong> ,</p>\n<p>\n	for the time-slot&nbsp;<strong>__DATE_TIME__</strong> and&nbsp;<strong>__LOCATION__</strong> as preferred location for sessions.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Below is the skype Id of the student.</p>\n<p>\n	Please add the student skype Id and start online tutoring.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>__STUDENT_ADDRESS__</strong></p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp; &nbsp; &nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Regards,</strong>&nbsp;<br />\n	<br />\n	<strong>__SITE_TITLE__</strong> | Tutor System</p>\n<p>\n	&nbsp;</p>\n', '2018-12-21 11:20:17', NULL, 'Active', NULL, NULL, 'Tutors'),
(8, 'Institute Enroll Success Email', 'Enrollment Request From Student', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>__SITE_LOGO__</strong></p>\n<p>\n	&nbsp;</p>\n<h2>\n	<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Welcome to __SITE_TITLE__ </strong></h2>\n<p>\n	&nbsp;</p>\n<p>\n	Hi,</p>\n<p>\n	Student&nbsp;<strong>__STUDENT_NAME__</strong>&nbsp;enrolled in the batch&nbsp;<strong>__BATCH_NAME__</strong></p>\n<p>\n	for the course&nbsp;<strong>__COURSE_NAME__</strong> offerred by institute&nbsp;<strong>__INSTITUTE_NAME__</strong> .</p>\n<p>\n	&nbsp;</p>\n<p>\n	Please&nbsp;<strong>__LOGIN_LINK__</strong> to view the enrollment details.</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Regards,</strong>&nbsp;<br />\n	<br />\n	<strong>__SITE_TITLE__</strong> | Tutor System</p>\n<p>\n	&nbsp;</p>\n', '2018-12-21 11:23:27', NULL, 'Active', NULL, NULL, 'Tutors'),
