INSERT INTO `pre_sections` (`section_id`, `name`, `description`) VALUES
(1, 'Advantages_Section', '<section>\n	<div class=\"container\">\n		<div class=\"row row-margin\">\n			<div class=\"col-md-4 col-sm-4 col-xs-12\">\n				<div class=\"advantage\">\n					<div class=\"media-left\">\n						<img alt=\"..\" src=\"http://phpstack-127011-688437.cloudwaysapps.com/assets/front/images/icn-video.png\" /></div>\n					<div class=\"media-body\">\n						<h4>\n							<a href=\"\">Videos &amp; Images</a></h4>\n						<p>\n							Listen to our teachers speeches and see our video testimonials before you take any decisions</p>\n					</div>\n				</div>\n			</div>\n			<div class=\"col-md-4 col-sm-4 col-xs-12\">\n				<div class=\"advantage\">\n					<div class=\"media-left\">\n						<img alt=\"..\" src=\"http://phpstack-127011-688437.cloudwaysapps.com/assets/front/images/icn-score.png\" /></div>\n					<div class=\"media-body\">\n						<h4>\n							<a href=\"\">Quality Scores</a></h4>\n						<p>\n							We have rated teachers for safety and convenience as we know how important this is for you</p>\n					</div>\n				</div>\n			</div>\n			<div class=\"col-md-4 col-sm-4 col-xs-12\">\n				<div class=\"advantage\">\n					<div class=\"media-left\">\n						<img alt=\"..\" src=\"http://phpstack-127011-688437.cloudwaysapps.com/assets/front/images/icn-calendar.png\" /></div>\n					<div class=\"media-body\">\n						<h4>\n							<a href=\"\">Reviews &amp; Ratings</a></h4>\n						<p>\n							No more emails, Calls or messaging friends for recommendations - Get acces to real reviews in seconds</p>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>\n<p>\n	&nbsp;</p>\n'),
(2, 'Are_You_A_Teacher_Section', '<section>\n	<div class=\"container\">\n		<div class=\"row row-margin\">\n			<div class=\"col-md-12\">\n				<h2 class=\"heading\">\n					Are you a <span>Teacher</span></h2>\n				<p class=\"heading-tag\">\n					Looking for a better way to reach your target audience? We can help - Just list with us <strong>For free</strong>.</p>\n			</div>\n			<div class=\"col-md-4 col-sm-4 col-sm-12\">\n				<div class=\"choose-block center-block\">\n					<div class=\"icon\">\n						<img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/icn-cal.png\" /></div>\n					<p>\n						Boost your sales and scale up all of your classes.</p>\n				</div>\n			</div>\n			<div class=\"col-md-4 col-sm-4 col-sm-12\">\n				<div class=\"choose-block center-block\">\n					<div class=\"icon\">\n						<img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/icn-group.png\" /></div>\n					<p>\n						Get a lot of exposure &amp; brand recognition from everyone.</p>\n				</div>\n			</div>\n			<div class=\"col-md-4 col-sm-4 col-sm-12\">\n				<div class=\"choose-block center-block\">\n					<div class=\"icon\">\n						<img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/icn-graph.png\" /></div>\n					<p>\n						Participate in various events and school programs whenever you want.</p>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>\n'),
(3, 'Featured_On_Section', '<section class=\"featured-on\">\n	<div class=\"container\">\n		<div class=\"row\">\n			<div class=\"col-lg-2 col-md-3 col-sm-3 col-xs-12\">\n				<h4>\n					FEATURED ON</h4>\n			</div>\n			<div class=\"col-lg-10 col-md-9 col-sm-9 col-xs-12\">\n				<ul>\n					<li>\n						<a href=\"#\"><img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/1.png\" /></a></li>\n					<li>\n						<a href=\"#\"><img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/2.png\" /></a></li>\n					<li>\n						<a href=\"#\"><img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/3.png\" /></a></li>\n					<li>\n						<a href=\"#\"><img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/4.png\" /></a></li>\n					<li>\n						<a href=\"#\"><img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/5.png\" /></a></li>\n					<li>\n						<a href=\"#\"><img alt=\"\" src=\"http://phpstack-127012-364022.cloudwaysapps.com/assets/front/images/6.png\" /></a></li>\n				</ul>\n			</div>\n		</div>\n	</div>\n</section>\n');
